FSDF Place Names Thematic Working Group Models 
The 'TWG Place Names' package contains:
- the FSDF Gazetteer application schema  (TWG Logical Model/FSDFGazetteer);
- the FSDF Gazetteer Mappings package (FSDF Gazetteer Mappings);
- the TWG product model (TWG Product Model/ISO 19112 Location by Identifier - WFS-G version);
- The FSDF Gazetteer requirements (TWG Requirements Model/TWG Place Names Requirements).

The FSDF Gazetteer Mappings package contains:
- the FSDF Gazetteer to ISO 19112 mappings (FSDF-Gazetteer to ISO 19112)
- the WFS-G version of ISO 19112 and its mapping to FSDF Gazetteer;
- the SIRF common gazetteer model and its mapping to FSDFGazetteer
